export function getShortestPath(startNode, endNode) {
  let shortestPath = [];
  let currentNode = endNode;
  while (currentNode !== null) {
    shortestPath.push(currentNode);
    currentNode = currentNode.previousNode;
  }
  return shortestPath.reverse();
}
